function ReviewList(reviews, key) {

  const firstFiveEntries = Array.from(reviews.slice(0, 5))

  firstFiveEntries.map((review) => {
    <div key={key} className='review'>
        <div className='review-author'>
          <img
            src={reviews.profile_photo_url}
            alt={reviews.author_name}
            className='review-avatar'
          />
          <h3>{reviews.author_name}</h3>
        </div>
        <p>{reviews.text}</p>
      </div>
  });

  return (
    <div>
      {firstFiveEntries}
    </div>
  );
}

export default ReviewList;
